const loadingDiv = document.getElementById('loading');
const errorDiv = document.getElementById('error');
const canvas = document.getElementById('canvas');
const ctx = canvas.getContext('2d');

const SECONDARY_DIAGONAL_CHARS = new Map([
	['a', 'data:image/png;base64,'],
	['b', 'data:image/png;base64,'],
	['c', 'data:image/png;base64,'],
	['d', 'data:image/png;base64,'],
	['e', 'data:image/png;base64,'],
	['f', 'data:image/png;base64,'],
	['g', 'data:image/png;base64,'],
	['h', 'data:image/png;base64,'],
	['i', 'data:image/png;base64,'],
	['j', 'data:image/png;base64,'],
	['k', 'data:image/png;base64,'],
	['l', 'data:image/png;base64,'],
	['m', 'data:image/png;base64,'],
	['n', 'data:image/png;base64,'],
	['o', 'data:image/png;base64,'],
	['p', 'data:image/png;base64,'],
	['q', 'data:image/png;base64,'],
	['r', 'data:image/png;base64,'],
	['s', 'data:image/png;base64,'],
	['t', 'data:image/png;base64,'],
	['u', 'data:image/png;base64,'],
	['v', 'data:image/png;base64,'],
	['w', 'data:image/png;base64,'],
	['x', 'data:image/png;base64,'],
	['y', 'data:image/png;base64,'],
	['z', 'data:image/png;base64,'],
])

async function generateDiagonal() {
	const text = document.getElementById('textInput').value.trim();
	const diagonalType = document.querySelector('input[name="diagonal"]:checked').value;

	// Reset
	errorDiv.style.display = 'none';
	canvas.style.display = 'none';

	if (!text) {
		showError('Por favor, digite um texto!');
		return;
	}

	loadingDiv.style.display = 'block';

	try {
		if (diagonalType === 'primary') {
			await generatePrimaryDiagonal(text, canvas, ctx, loadingDiv);
		} else {
			await generateSecondaryDiagonal(text, canvas, ctx, loadingDiv);
		}
	} catch (error) {
		loadingDiv.style.display = 'none';
		showError('Erro: ' + error.message);
	}
}

async function generatePrimaryDiagonal(text, canvas, ctx, loadingDiv) {
	const urlText = text.replace(/\s+/g, '+');
	const url = `https://corsproxy.io/?${encodeURIComponent(`https://habbofont.net/font/habbo_oldschool/${urlText}.gif`)}`;

	const img = new Image();
	img.crossOrigin = 'anonymous';

	img.onload = function() {
		loadingDiv.style.display = 'none';

		const chars = detectCharacters(img, ctx);
		const finalChars = injectSpaces(chars, text);

		if (chars.length === 0) {
			showError('Não foi possível detectar caracteres na imagem!');
			return;
		}

		createPrimaryDiagonal(finalChars, canvas, ctx);
	};

	img.onerror = function() {
		loadingDiv.style.display = 'none';
		showError('Erro ao carregar a imagem. Tente outro texto.');
	};

	img.src = url;
}

async function generateSecondaryDiagonal(text, canvas, ctx, loadingDiv) {
	const chars = [];

	// Processar cada caractere do texto
	for (const char of text) {
		if (char === ' ') {
			// Adicionar espaço
			chars.push({
				canvas: null,
				width: 28,
				height: 20,
				isSpace: true
			});
		} else {
			const lowerChar = char.toLowerCase();
			const base64Data = SECONDARY_DIAGONAL_CHARS.get(lowerChar);

			if (!base64Data) {
				loadingDiv.style.display = 'none';
				showError(`Caractere '${char}' não encontrado no mapa de caracteres!`);
				return;
			}

			// Criar imagem do caractere
			const charCanvas = await loadCharacterImage(base64Data);
			chars.push({
				canvas: charCanvas,
				width: charCanvas.width,
				height: charCanvas.height,
				isSpace: false
			});
		}
	}

	loadingDiv.style.display = 'none';

	if (chars.length === 0) {
		showError('Não foi possível gerar os caracteres!');
		return;
	}

	createSecondaryDiagonal(chars, canvas, ctx);
}

function loadCharacterImage(base64Data) {
	return new Promise((resolve, reject) => {
		const img = new Image();
		img.onload = function() {
			const canvas = document.createElement('canvas');
			canvas.width = img.width;
			canvas.height = img.height;
			const ctx = canvas.getContext('2d');
			ctx.drawImage(img, 0, 0);
			resolve(canvas);
		};
		img.onerror = reject;
		img.src = base64Data;
	});
}

function detectCharacters(img, ctx) {
	const tempCanvas = document.createElement('canvas');
	tempCanvas.width = img.width;
	tempCanvas.height = img.height;
	const tempCtx = tempCanvas.getContext('2d');
	tempCtx.drawImage(img, 0, 0);

	const imageData = tempCtx.getImageData(0, 0, img.width, img.height);
	const data = imageData.data;

	const columns = [];
	for (let x = 0; x < img.width; x++) {
		let hasPixel = false;
		for (let y = 0; y < img.height; y++) {
			const i = (y * img.width + x) * 4;
			const alpha = data[i + 3];
			if (alpha > 0) {
				hasPixel = true;
				break;
			}
		}
		columns.push(hasPixel);
	}

	const chars = [];
	let start = -1;

	for (let x = 0; x < columns.length; x++) {
		if (columns[x] && start === -1) {
			start = x;
		} else if (!columns[x] && start !== -1) {
			const width = x - start;
			const charCanvas = document.createElement('canvas');
			charCanvas.width = width;
			charCanvas.height = img.height;
			const charCtx = charCanvas.getContext('2d');
			charCtx.drawImage(img, start, 0, width, img.height, 0, 0, width, img.height);

			chars.push({
				canvas: charCanvas,
				width: width,
				height: img.height
			});

			start = -1;
		}
	}

	if (start !== -1) {
		const width = columns.length - start;
		const charCanvas = document.createElement('canvas');
		charCanvas.width = width;
		charCanvas.height = img.height;
		const charCtx = charCanvas.getContext('2d');
		charCtx.drawImage(img, start, 0, width, img.height, 0, 0, width, img.height);

		chars.push({
			canvas: charCanvas,
			width: width,
			height: img.height
		});
	}

	return chars;
}

function injectSpaces(chars, text) {
	const SPACE_WIDTH = 28;
	const SPACE_HEIGHT = chars[0]?.height || 20;

	let result = [];
	let charIndex = 0;

	for (const c of text) {
		if (c === ' ' || c === '+') {
			result.push({
				canvas: null,
				width: SPACE_WIDTH,
				height: SPACE_HEIGHT,
				isSpace: true
			});
		} else {
			result.push(chars[charIndex]);
			charIndex++;
		}
	}

	return result;
}

function createPrimaryDiagonal(chars, canvas, ctx) {
	if (chars.length === 0) return;

	const horizontalOffset = -8;
	const charHeight = chars[0].height;

	let totalWidth = 0, totalHeight = 0;
	chars.forEach((char, i) => {
		totalWidth += char.width + (i ? horizontalOffset : 0);
		totalHeight += i ? Math.ceil((chars[i-1].width + horizontalOffset) / 2) : char.height;
	});

	canvas.width = totalWidth;
	canvas.height = totalHeight;
	ctx.clearRect(0, 0, canvas.width, canvas.height);

	let currentX = 0;
	let currentY = canvas.height - chars[0].height;

	const positions = chars.map(char => {
		const pos = { x: currentX, y: currentY };
		currentX += char.width + horizontalOffset;
		currentY -= Math.ceil((char.width + horizontalOffset) / 2);
		return pos;
	});

	for (let i = chars.length - 1; i >= 0; i--) {
		if (chars[i].isSpace) continue;
		ctx.drawImage(chars[i].canvas, positions[i].x, positions[i].y);
	}

	canvas.style.display = 'block';
}

function createSecondaryDiagonal(chars, canvas, ctx) {
	if (chars.length === 0) return;

	const horizontalOffset = -8;

	let totalWidth = 0, totalHeight = 0;
	chars.forEach((char, i) => {
		totalWidth += char.width + (i ? horizontalOffset : 0);
		totalHeight += i ? Math.ceil((chars[i-1].width + horizontalOffset) / 2) : char.height;
	});

	canvas.width = totalWidth;
	canvas.height = totalHeight;
	ctx.clearRect(0, 0, canvas.width, canvas.height);

	let currentX = 0;
	let currentY = 0;

	const positions = chars.map(char => {
		const pos = { x: currentX, y: currentY };
		currentX += char.width + horizontalOffset;
		currentY += Math.ceil((char.width + horizontalOffset) / 2);
		return pos;
	});

	for (let i = 0; i < chars.length; i++) {
		if (chars[i].isSpace) continue;
		ctx.drawImage(chars[i].canvas, positions[i].x, positions[i].y);
	}

	canvas.style.display = 'block';
}

function showError(message) {
	const errorDiv = document.getElementById('error');
	errorDiv.textContent = message;
	errorDiv.style.display = 'block';
}

// Permitir Enter para gerar
document.getElementById('textInput').addEventListener('keypress', function(e) {
	if (e.key === 'Enter') {
		generateDiagonal();
	}
});

canvas.addEventListener('click', function () {
  const imageDataUrl = canvas.toDataURL('image/png');
  const newTab = window.open();
  newTab.document.write('<img src="' + imageDataUrl + '" alt="Canvas Image"/>');
})

generateDiagonal();
